import ColumnFilter from './ColumnFilter';

let COLUMNS = [
    {
        Header: 'Name',
        accessor: 'full_name'
    },
    {
        Header: 'Pos',
        accessor: 'pos'
    },
    {
        Header: 'Ovr',
        accessor: 'ovr'
    }
];

export {COLUMNS};
